INSERT INTO `f20_learning_objectives_util` VALUES (1,'Cognitive Skills','Students will engage in informed debate, principled dissent, critical thinking/analysis, problem solving, and acceptance/appreciation of multiple perspectives.'),(2,'Communication Skills','Students will engage in activities that improve verbal, non-verbal, and listening skills. (May include marketing and promotion experience.)'),(3,'Computer and Technology Skills','Students will increase their information literacy through interaction with software, databases, audio/visual technology, and other technologies.'),(4,'Cultural Knowledge','Through engagement with culture(s) other than the students own, the student will develop a deeper understanding of global communities and cultures.'),(5,'Ethical Reasoning','The student will make ethical decisions in the best interest of the group and greater community without trying to advance the student\'s own agenda.'),(6,'Leadership Skills','The student will improve her/his/their ability to lead, interact, represent, and inspire others, as well as the ability to delegate and provide critical feedback to members of a group.'),(7,'Financial Management','The student will improve her/his/their knowledge and experience with managing/ planning budgets and finances.'),(8,'Reading and Writing Proficiency','The student will improve her/his/their ability to (1) read and interpret literature/documents to acquire knowledge in a subject area and (2) write proficiently without spelling, grammar, or comprehension errors.'),(9,'Social Responsibility','The student will develop an awareness and commitment to social justice, civic engagement, personal responsibility and equitable treatment of others.'),(10,'Teamwork','Working with a group of people for an extended period, the student will demonstrate mature, respectful, professional and collaborative relationships with others and the ability to trust and be trusted for the common good of the team.'),(14,'Custom Learning Objective','description');
