r to Dean and also emails Dean login info.','/steps/0000000007.php',NULL,NULL),(8,1,2,3,'Secretary Form','[participating users = secretary] secretary fill-in form f1 to create/generate an app(enter student email, select Course, Faculty, Chair, Dean), the system automatically generates an urgent message from Secretary to the primary user of the NEXT step (Student) and also  emails student login info','/steps/0000000008.php','2020-11-20 21:45:59','2020-11-10 21:47:51'),(9,1,2,3,'Student Form','[participating users = student] Student fill-in the (fieldwork) form f2 including Supervisor info, the system automatically generates an urgent message from Student to the primary user of the NEXT step (Faculty) and also emails faculty login info','/steps/0000000009.php',NULL,NULL),(10,1,2,3,'Faculty 1 Form','[participating users = faculty] Faculty fill-in form f3 to specify the Learning Outcomes (LO), the system automatically generates a message from Faculty to the primary user of the NEXT step (Supervisor) and also emails Supervisor login info.','/steps/0000000010.php',NULL,NULL),(11,1,2,3,'Chair Form','[participating users = Chair] Chair fill-in the form f5 approving or rejecting, the system automatically generates a message from Chair to Dean and also emails Dean login info.','/steps/0000000011.php',NULL,NULL),(12,2,2,3,'Dean Form','[participating users = Dean] Dean fill-in the form f6 approving or rejecting, the system automatically generates a message from Chair to Dean and also emails Dean login info.','/steps/0000000012.php',NULL,NULL);
